import React from 'react';

const Options: React.FC = () => {
  return (
    <div className="container">
      <div className="display-name text-center">
        <h2>Good Afternoon, [ DISPLAY NAME ]</h2>
        <h4>Which type of payment would you like to perform?</h4>
        <h6>Select only one type</h6>
      </div>
      <div className="display-options mx-auto row">
        <div className="col-sm-3">
          <div className="card">hey</div>
        </div>
        <div className="col-sm-3">smksd</div>
        <div className="col-sm-3">lsdms</div>
        <div className="col-sm-3">sldmk</div>
      </div>
    </div>
  );
};

export { Options };
